import logo from './logo.svg';
import './App.css';
import { Route, Switch } from 'react-router-dom';
import home from './././Components/home';
import findingredients from './Components/findrecipes';


function App() {
  return (
    <div className="App">
      <Switch>
      <Route path = '/'  component={home} exact/>
      <Route path ='/findingredients' component={findingredients} exact/>
      </Switch>
    </div>
  );
}

export default App;
